import React from "react";
import Jumbotron from "../partials/Jumbotron";

const Book = () => {
    return (
        <main>
            <Jumbotron title="Ready To Learn?" />
            <section class="container">
                <div class="square-frame">
                    <script src="js/order.js"></script>
                </div>
            </section>
        </main>
    );
};

export default Book;
